import React from 'react'
import { View, Text } from 'react-native'
import { StatusBar } from "react-native";

const NavBar = () => {
    return (

        <StatusBar style={{ color: 'white', flex: 1, marginTop: 30, backgroundColor: 'green' }}>
            <Text style={{ color: 'white', flex: 1, marginTop: 30, backgroundColor: 'green' }}>Soy el navbar</Text>
        </StatusBar>
    )
}

export default NavBar
